import React from 'react'

const ChatBox = (props) => {

    const {onClose, from, to} = props;

    return (
        <div className="chatbox">
            <input type="text" placeholder="Type Here"></input>
            <div>{`${from.name} to ${to.name}`}</div>
            <div className="chatbox-buttons">
                <button type="submit" className="button-chatbox-send">Send</button>
                <button type="submit" className="button-chatbox-cancel" onClick={onClose}>Cancel</button>
            </div>
        </div>
    );
}

export default ChatBox;
